import React from "react";

const Carte = ({ carte, onContextMenu }) => (
  <div className="carte" onContextMenu={onContextMenu}>
    <img src={carte.image_url} alt={carte.nom} />
    <p>{carte.nom}</p>
  </div>
);

export default Carte;
